import React from "react";

const PoseInfoBlock = ({ poseLabel, poseMap }) => {
  return (
    <div className="pose-info-block">
      <h2>Current Pose</h2>
      <p>{poseMap[poseLabel] || "Unknown Pose"}</p>
    </div>
  );
};

export default PoseInfoBlock;
